import React, { Component } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

class SignIn extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Box
        component="form"
        sx={{
          '& .MuiTextField-root': { m: 1, width: '25ch' },
          color: 'text.primary'
        }}
        noValidate
        autoComplete="off"
      >
        <TextField 
          id="standard-basic" 
          label="Name" 
          variant="standard" />
      </Box>
    )
  }
}

export default SignIn;
